export async function getSwapRouteV1() {
  // Get the path to be called
  const targetChain = ChainName.MATIC;
  const targetPath = `/${targetChain}/api/v1/routes`;

  // Specify the call parameters (only the required params are specified here, see Docs for full list)
  const targetPathConfig = {
    params: {
      tokenIn: ALT_NATIVE_ADDRESS,
      tokenOut: tokenOut.address,
      amountIn: Number(1 * 10 ** tokenIn.decimals).toString()
    }
  };

  // Call the API with axios to handle async calls
  try {
    console.log(`\nCalling [V1] Get Swap Route...`);
    const { data } = await axios.get(
      AggregatorDomain + targetPath,
      targetPathConfig
    )

    console.log(`[V1] GET Response:`);
    console.log(data);
    return data.data;
  } catch (error) {
    console.log(error);
  };

};



export async function postSwapRouteV1() {
  // Get the path to be called
  const targetChain = ChainName.MATIC;
  const targetPath = `/${targetChain}/api/v1/route/build`;

  // Get the route summary data to be encoded
  const swapRouteData = await getSwapRouteV1();
  const routeSummary = swapRouteData.routeSummary;

  // Get the signer's address
  const signerAddress = "0x22f5413C075Ccd56D575A54763831C4c27A37Bdb"

  // Configure the request body (refer to Docs for the full list)
  const requestBody = {
    routeSummary: routeSummary,
    sender: signerAddress,
    recipient: signerAddress,
    slippageTolerance: 10 //0.1%
  }

  // Call the API with axios to handle async calls
  try {
    console.log(`\nCalling [V1] Post Swap Route For Encoded Data...`);
    const { data: kyberSwapData } = await axios.post(
      AggregatorDomain + targetPath,
      requestBody
    );

    console.log(`[V1] POST Response:`);
    console.log(kyberSwapData.data);
    return kyberSwapData.data;
  } catch (error) {
    console.log(error);
  };
}


